import React from 'react';
import './Badge.css';

function Badge(props) {
  return (
    <div>
      <li className='ad-badge-wrap'>
        <div className='ad-badge'> 
        <img src ={props.src} />
        <div className='ad-badge-text'>
        <h3>{props.badge_name}</h3>
        <p>{props.description}</p>
        </div>
        </div>
        
        
      </li>
    </div>
  )
}

export default Badge
